【Bluetooth V4.1技術】Bluetooth 4.1バージョンで、接続の安定性と優れた音質を持ちます。スマートフォン、タブレットなどのBluetooth対応デバイスと簡単かつ迅速にペアリングします。通信距離は約10メートル。<br>
【長い連続聴取時間】たった一回1.5時間のフル充電だけで、2時間以上連続音楽再生ができます。待機時間は40時間もあり、電量不足を心配せず安心してご使用いただけます。<br>
【小型、軽量】
トレーニング、ドライブ、ウォーキング、デスクワーク、作業中、通勤、通学、DVD鑑賞、電話会議など、様々なシーンで使用可能。<br>

<br>
▼商品説明<br>

商品仕様<br>
商品本体寸法：　28x20x28mm<br>
イヤホン単体重量：　5.0g　<br>
カラー：　ブラック/ホワイト/レッド/シルバー<br>
対応プロファイル：HFP/HSP/A2DP/AVRCP<br>
ブルートゥース：Ver 4.1<br>
連続待受時間：最大約40時間<br>
連続通話時間：最大約2時間<br>
連続音楽再生時間：最大約2時間<br>
イヤホンフル充電時間：約1～2時間<br>
最大通信距離：最大約10メートル<br>
（※障害物がない場合）<br>
使用電池タイプ：リチウムポリマー電池<br>

製造：中国製<br>
説明書について<br>
中国語と英語説明書を付属しています。一部輸入品日本語説明書は電子版メールで発信可能です。<br>

K2E6 日本語説明書(ダウンロード)<br><br> 

注意事項 <br>
通話機能が付属されております<br>
※品質向上のため、仕様は予告なしに変更される場合があります。<br>
※実物と画像では、見た目の色に多少違いがある場合がございます。<br>
※一部輸入品のパッケージは輸入国の言語が記載されております。<br>
